import{U as s,i as t}from"./vendor.c07f43a6.js";const n=s({name:"Markdown"});n.render=()=>t("div",{class:["md2vue-wrapper","markdown-body"],innerHTML:'<h2 id="button-按钮">Button 按钮</h2>\n<p>常用的操作按钮。</p>\n<h3 id="基础用法">基础用法</h3>\n<p>基础的按钮用法。</p>\n<p>使用<code>type</code>、<code>round</code>和<code>circle</code>属性来定义 Button 的样式。</p>\n<pre><code class="language-html"><div class="md-code-hijs">&lt;template&gt;\n  &lt;<span class="hljs-keyword">pl</span>-button <span class="hljs-keyword">type</span>=<span class="hljs-string">&quot;default&quot;</span>&gt;默认按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n  &lt;<span class="hljs-keyword">pl</span>-button <span class="hljs-keyword">type</span>=<span class="hljs-string">&quot;primary&quot;</span>&gt;主要按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n  &lt;<span class="hljs-keyword">pl</span>-button <span class="hljs-keyword">type</span>=<span class="hljs-string">&quot;success&quot;</span>&gt;成功按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n  &lt;<span class="hljs-keyword">pl</span>-button <span class="hljs-keyword">type</span>=<span class="hljs-string">&quot;warning&quot;</span>&gt;警告按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n  &lt;<span class="hljs-keyword">pl</span>-button <span class="hljs-keyword">type</span>=<span class="hljs-string">&quot;danger&quot;</span>&gt;危险按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n\n  &lt;<span class="hljs-keyword">pl</span>-button round&gt;圆角按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n  &lt;<span class="hljs-keyword">pl</span>-button <span class="hljs-keyword">type</span>=<span class="hljs-string">&quot;primary&quot;</span> round&gt;主要按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n  &lt;<span class="hljs-keyword">pl</span>-button <span class="hljs-keyword">type</span>=<span class="hljs-string">&quot;success&quot;</span> round&gt;成功按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n  &lt;<span class="hljs-keyword">pl</span>-button <span class="hljs-keyword">type</span>=<span class="hljs-string">&quot;warning&quot;</span> round&gt;警告按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n  &lt;<span class="hljs-keyword">pl</span>-button <span class="hljs-keyword">type</span>=<span class="hljs-string">&quot;danger&quot;</span> round&gt;危险按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n&lt;/template&gt;</div>\n</code></pre>\n<h3 id="禁用状态">禁用状态</h3>\n<p>按钮不可用状态。</p>\n<p>你可以使用<code>disabled</code>属性来定义按钮是否可用，它接受一个<code>Boolean</code>值。</p>\n<pre><code class="language-html"><div class="md-code-hijs">&lt;template&gt;\n  &lt;<span class="hljs-keyword">pl</span>-button disabled&gt;默认按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n  &lt;<span class="hljs-keyword">pl</span>-button <span class="hljs-keyword">type</span>=<span class="hljs-string">&quot;primary&quot;</span> disabled&gt;主要按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n  &lt;<span class="hljs-keyword">pl</span>-button <span class="hljs-keyword">type</span>=<span class="hljs-string">&quot;success&quot;</span> disabled&gt;成功按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n  &lt;<span class="hljs-keyword">pl</span>-button <span class="hljs-keyword">type</span>=<span class="hljs-string">&quot;warning&quot;</span> disabled&gt;警告按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n  &lt;<span class="hljs-keyword">pl</span>-button <span class="hljs-keyword">type</span>=<span class="hljs-string">&quot;danger&quot;</span> disabled&gt;危险按钮&lt;/<span class="hljs-keyword">pl</span>-button&gt;\n&lt;/template&gt;</div>\n</code></pre>\n<h3 id="文字按钮">文字按钮</h3>\n<p>没有边框和背景色的按钮。</p>\n<pre><code class="language-html"><div class="md-code-hijs"><span class="hljs-tag">&lt;<span class="hljs-name">template</span>&gt;</span>\n  <span class="hljs-tag">&lt;<span class="hljs-name">pl-button</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;text&quot;</span>&gt;</span>文字按钮<span class="hljs-tag">&lt;/<span class="hljs-name">pl-button</span>&gt;</span>\n  <span class="hljs-tag">&lt;<span class="hljs-name">pl-button</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;text&quot;</span> <span class="hljs-attr">disabled</span>&gt;</span>文字按钮<span class="hljs-tag">&lt;/<span class="hljs-name">pl-button</span>&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">template</span>&gt;</span></div>\n</code></pre>\n<h3 id="不同尺寸">不同尺寸</h3>\n<p>Button 组件提供除了默认值以外的三种尺寸，可以在不同场景下选择合适的按钮尺寸。</p>\n<p>额外的尺寸：<code>normal</code>、<code>small</code>、<code>lager</code>，通过设置<code>size</code>属性来配置它们。</p>\n<pre><code class="language-html"><div class="md-code-hijs"><span class="hljs-tag">&lt;<span class="hljs-name">template</span>&gt;</span>\n  <span class="hljs-tag">&lt;<span class="hljs-name">pl-button</span>&gt;</span>默认按钮<span class="hljs-tag">&lt;/<span class="hljs-name">pl-button</span>&gt;</span>\n  <span class="hljs-tag">&lt;<span class="hljs-name">pl-button</span> <span class="hljs-attr">size</span>=<span class="hljs-string">&quot;small&quot;</span>&gt;</span>小型按钮<span class="hljs-tag">&lt;/<span class="hljs-name">pl-button</span>&gt;</span>\n  <span class="hljs-tag">&lt;<span class="hljs-name">pl-button</span> <span class="hljs-attr">size</span>=<span class="hljs-string">&quot;lager&quot;</span>&gt;</span>大型按钮<span class="hljs-tag">&lt;/<span class="hljs-name">pl-button</span>&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">template</span>&gt;</span></div>\n</code></pre>\n<h3 id="attributes">Attributes</h3>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>可选值</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>size</td>\n<td>尺寸</td>\n<td>string</td>\n<td>normal / small / lager</td>\n<td>normal</td>\n</tr>\n<tr>\n<td>type</td>\n<td>类型</td>\n<td>string</td>\n<td>default / primary / success / warning / danger / text</td>\n<td>default</td>\n</tr>\n<tr>\n<td>round</td>\n<td>是否圆角按钮</td>\n<td>boolean</td>\n<td>—</td>\n<td>false</td>\n</tr>\n<tr>\n<td>circle</td>\n<td>是否圆形按钮</td>\n<td>boolean</td>\n<td>—</td>\n<td>false</td>\n</tr>\n<tr>\n<td>plain</td>\n<td>是否空心按钮</td>\n<td>boolean</td>\n<td>—</td>\n<td>false</td>\n</tr>\n<tr>\n<td>disabled</td>\n<td>是否禁用状态</td>\n<td>boolean</td>\n<td>—</td>\n<td>false</td>\n</tr>\n</tbody></table>\n<h3 id="slots">Slots</h3>\n<table>\n<thead>\n<tr>\n<th>name</th>\n<th>说明</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>(default)</td>\n<td>按钮inner</td>\n</tr>\n</tbody></table>\n'}),n.mounted=()=>{};export{n as default};
